/// Static utility class that provides a library of pre-serialized meshes for testing.
template <class MeshType>
class TestMeshLibrary
{
public:

    /// Identifier that identifies library meshes by name.
    enum HullMeshID
    {
        MESH_SKATE_SCENE_001,

        NUMBER_OF_MESHES
    };

    /// Reads the mesh with the given ID from the mesh library
    static bool GetMesh(MeshType &mesh, const HullMeshID id)
    {
        eastl::string buffer;

        // Build the stream buffer from the indicated string array.
        switch (id)
        { 
            case MESH_SKATE_SCENE_001:              ConstructBuffer(s_skate_scene_001, buffer);          break;

            default: EA_FAIL_MSG("TestMeshLibrary: Unexpected mesh index");
        }

        // Serialize the mesh in from the XML data.
        return ReadMesh(
            buffer.data(),
            buffer.size(),
            mesh);
    }

private:

    static const uint32_t MAX_MESH_LINES = 32768;

    static const char *s_skate_scene_001[];

    /// Adds all of the strings in the provided string array onto the provided buffer string.
    /// The end of the string array is signaled by a string with value "END".
    static void ConstructBuffer(const char *const strings[], eastl::string &buffer)
    {
        uint32_t line = 0;
        while (strcmp(strings[line], "END") != 0 && line != MAX_MESH_LINES)
        {
            buffer += eastl::string(strings[line]);
            ++line;
        }

        EA_ASSERT_MSG(line != MAX_MESH_LINES, "Missing END marker on mesh string array");
    }

    static bool ReadMesh(const char *const streamBuffer, const size_t STREAM_BUFFER_SIZE, MeshType &mesh)
    {
        // Create input archive.

        std::string iString(streamBuffer);
        std::istringstream iStream(iString);
        EA::Serialization::xml_iarchive iArchive(iStream);

        meshoperate::serialization::SerializableMesh<MeshType> meshAdapter(mesh);
        iArchive & meshAdapter;

        // Serialization doesn't assert, instead this result flag is reset.
        return iArchive.good();
    }
};


